import { BrowserRouter, Routes, Route } from 'react-router-dom'

// Pages
import Home from './pages/Home';
import About from './pages/About';
import Features from './pages/Features';
import Contact from './pages/Contact';

// Components
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <div className='pages'>
          <Routes>
            {/* The main dynamic page (Log/Dashboard) is used for both / and /log */}
            <Route 
              path="/" 
              element={<Home />}
            />
            <Route 
              path="/log" 
              element={<Home />}
            />
            {/* Static pages */}
            <Route 
              path="/about" 
              element={<About />}
            />
            <Route 
              path="/features" 
              element={<Features />}
            />
            <Route 
              path="/contact" 
              element={<Contact />}
            />
          </Routes>
        </div>
      </BrowserRouter>

    </div>
  );
}

export default App;
